1.2.1 整体逻辑 flowchart LR A[需求创建] --&gt; B[倒舟开始] --&gt; C[前置任务] --&gt; D[机械臂搬运] --&gt; E[后置任务] --&gt;F[倒舟结束] 1.2.2 需求创建 需求创建每个方向单独计算,下面说的agv都是同一个方向的. 关联数据 agvToCatch: 带着下线舟的抓舟agv/从镀膜机接完料的agv/准备送去倒舟机抓舟口的agv(数量) agvFromCatch: 带着上线舟的抓舟agv/从倒舟机抓舟口接完料的agv(数量) storageToCatch: 一个带着待倒上线舟的库位, 允许不存在 storageToCatchEmpty: 一个可以送去倒舟机背负口的空货架, 允许不存在 agvCache: 设置的预留抓舟agv/ 提前倒好准备被镀膜机叫送料的agv(数量) 逻辑判断 if (agvToCatch > 0) { // 存在带着下线舟的agv if (存在storageToCatch 且 agvCache > agvFromCatch) { // 库位这边有上线舟可以换 且 预留agv数量没满 创建满换满倒舟需求 } else if (存在storageToCatchEmpty) { // 库位有空货架可以接倒下来的下线舟 创建单下需求 }
} else if (agvCache > agvFromCatch 且 存在storageToCatch) { // 预留agv数量没满 且 库位有上线舟可以倒 创建单上需求
} 1.2.3 需求执行 flowchart LR A[倒舟开始] subgraph 创建执行前置任务 direction TB B1[抓舟口上料 背负口上满] B2[背负口上满] B3[抓舟口上料] end subgraph 满换满 direction LR C1_0[背负转暂存] C1_1[抓舟转背负] C1_2[暂存转抓舟] end subgraph "前置任务完成,机械臂搬运" direction TB 满换满 C2[背负转抓舟] C3[抓舟转背负] end subgraph "机械臂搬运完成,创建执行后置任务" direction TB D1[抓舟口下料 背负口下满] D2[抓舟口下料 背负口下空] D3[背负口下满] end E[后置任务完成,倒舟需求完成] A --满换满--&gt; B1 A --单上--&gt; B2 A --单下--&gt; B3 B1 --&gt; C1_0 --&gt; C1_1 --&gt; C1_2 B2 --&gt; C2 B3 --&gt; C3 C1_2 --&gt; D1 C2 --&gt; D2 C3 --&gt; D3 D1 --&gt; E D2 --&gt; E D3 --&gt; E

